import React, { useState } from 'react';
import './TaskFlow.css'; // 스타일 파일 임포트

function TaskFlow() {
    const [taskFlowName, setTaskFlowName] = useState('');

    const handleAddTaskFlow = () => {
        // 추가할 작업 플로우 처리 로직
        console.log('작업 플로우 추가:', taskFlowName);
    };

    return (
        <div className="task-flow-container">
            <h4>작업 플로우 생성</h4>
            <input 
                type="text" 
                value={taskFlowName} 
                onChange={(e) => setTaskFlowName(e.target.value)} 
                placeholder="작업 플로우 이름 입력"
                className="task-flow-input"
            />
            <button onClick={handleAddTaskFlow} className="task-flow-button">플로우 추가</button>
        </div>
    );
}

export default TaskFlow;
